import { IMAGE } from "../constants/image";

let data;

export default data = [
  {
    id: 1,
    agency: "กระทรวงมหาดไทย (ศบค.มท.)",
    image: IMAGE.IMAGE_AGENCY1,
    link:
      "http://www.moicovid.com/",
  },
  {
    id: 2,
    agency: "กระทรวงสาธารณสุข",
    image: IMAGE.IMAGE_AGENCY2,
    link:
      " https://www3.dmsc.moph.go.th/",
  },
  {
    id: 3,
    agency: "World Health Organization (WHO)",
    image: IMAGE.IMAGE_AGENCY3,
    link:
      "https://www.who.int/",
  },
  
];
